import React from 'react';
import { useTelemetry } from '../../context/TelemetryContext';
import './StatusPanel.css';

const StatusPanel = () => {
  const { telemetry, connectionStatus, sendCommand } = useTelemetry();

  // Default MAVLink values
  const defaultTelemetry = {
    mode: 'GUIDED',
    armed: false,
    satellites: 15,
    battery_remaining: 95.0,
    alt: 100.0,
    groundspeed: 0.0,
    heading: 0,
    voltage_battery: 12.6,
    current_battery: 0.0,
    rssi: -55,
    roll: 0.0,
    pitch: 0.0,
    system_status: 'STANDBY'
  };

  const data = { ...defaultTelemetry, ...telemetry };

  const statusItems = [
    {
      label: 'Flight Mode',
      value: data.mode,
      icon: 'üöÄ',
      color: '#3b82f6'
    },
    {
      label: 'Armed',
      value: data.armed ? 'ARMED' : 'DISARMED',
      icon: data.armed ? 'üî¥' : 'üü¢',
      color: data.armed ? '#ef4444' : '#10b981'
    },
    {
      label: 'GPS Satellites',
      value: `${data.satellites} (3D Fix)`,
      icon: 'üõ∞Ô∏è',
      color: '#8b5cf6'
    },
    {
      label: 'Battery',
      value: `${data.battery_remaining.toFixed(1)}% ‚Ä¢ ${data.voltage_battery.toFixed(1)}V`,
      icon: 'üîã',
      color: data.battery_remaining > 30 ? '#f59e0b' : '#ef4444'
    },
    {
      label: 'Altitude',
      value: `${data.alt.toFixed(1)}m`,
      icon: 'üìè',
      color: '#06b6d4'
    },
    {
      label: 'Speed',
      value: `${data.groundspeed.toFixed(1)} m/s`,
      icon: '‚ö°',
      color: '#10b981'
    },
    {
      label: 'Heading',
      value: `${Math.round(data.heading)}¬∞`,
      icon: 'üß≠',
      color: '#6366f1'
    },
    {
      label: 'Signal RSSI',
      value: `${data.rssi.toFixed(0)} dBm`,
      icon: 'üì∂',
      color: data.rssi > -70 ? '#10b981' : '#f59e0b'
    }
  ];

  const handleArmCommand = () => {
    const command = data.armed ? 'DISARM' : 'ARM';
    sendCommand(command);
  };

  const handleRTLCommand = () => {
    sendCommand('RTL');
  };

  const handleGuidedCommand = () => {
    sendCommand('GUIDED');
  };

  return (
    <div className="status-panel">
      <div className="panel-header">
        <h3>üöÄ MAVLink Status</h3>
        <div className={`connection-badge ${connectionStatus}`}>
          {connectionStatus.toUpperCase()}
        </div>
      </div>

      <div className="status-grid">
        {statusItems.map((item, index) => (
          <div key={index} className="status-item">
            <div className="status-icon" style={{ color: item.color }}>
              {item.icon}
            </div>
            <div className="status-info">
              <div className="status-label">{item.label}</div>
              <div className="status-value" style={{ color: item.color }}>
                {item.value}
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* MAVLink System Info */}
      <div className="system-info">
        <div className="info-row">
          <span>System Status:</span>
          <span>{data.system_status}</span>
        </div>
        <div className="info-row">
          <span>Location:</span>
          <span>Bangalore, India</span>
        </div>
        <div className="info-row">
          <span>Protocol:</span>
          <span>MAVLink v2.0</span>
        </div>
        <div className="info-row">
          <span>Last Update:</span>
          <span>{telemetry.timestamp ? new Date(telemetry.timestamp * 1000).toLocaleTimeString() : new Date().toLocaleTimeString()}</span>
        </div>
      </div>

      {/* MAVLink Control Buttons */}
      <div className="control-buttons">
        <button 
          className={`btn-control ${data.armed ? 'btn-disarm' : 'btn-arm'}`}
          onClick={handleArmCommand}
        >
          {data.armed ? 'üî¥ DISARM' : 'üü¢ ARM'}
        </button>
        <button className="btn-control btn-rtl" onClick={handleRTLCommand}>
          üè† RTL
        </button>
        <button className="btn-control btn-guided" onClick={handleGuidedCommand}>
          üß≠ GUIDED
        </button>
      </div>

      {/* MAVLink Protocol Info */}
      <div className="protocol-info">
        <div className="protocol-badge">MAVLink</div>
        <div className="protocol-badge">WebRTC</div>
        <div className="protocol-badge">4G/LTE</div>
        <div className="protocol-badge">ZeroTier</div>
      </div>
    </div>
  );
};

export default StatusPanel;
